import axios from "axios";
import { useLocation } from "react-router-dom";
const Tv = () => {
    const location = useLocation();
    async function getData() {
        const response =
            await axios.get(`https://api.themoviedb.org/3/tv/${location.state.id}?api_key=692ad17fefe3f279a5bc0dfa87752845&language=en-US
        `);
        console.log(response);
    }
    getData();

    return (
        <div className="tv">
            <h1>tv</h1>
        </div>
    );
};

export default Tv;
